using LiveSplit.Options;
using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Runtime.Serialization.Formatters.Binary;

namespace LiveSplit.LinkToThePast
{
    /// <summary>
    /// Icons for LiveSplit
    /// </summary>
    class SplitIcons : Dictionary<String, Image>
    {
        public SplitIcons()
        {
            // Normal game icons
            Add("Hyrule Castle", "");
            Add("Eastern Palace", "");
            Add("Desert Palace", "");
            Add("Tower of Hera", "");
            Add("Hyrule Castle Tower", "");
            Add("Palace of Darkness", "");
            Add("Thieves' Town", "");
            Add("Skull Woods", "");
            Add("Ice Palace", "");
            Add("Swamp Palace", "");
            Add("Misery Mire", "");
            Add("Turtle Rock", "");
            Add("Ganon's Tower", "");
            Add("Triforce", "");

            // Items, only used in the randomizer
            Add("Bow", "");
            Add("Flute", "");
            Add("Hammer", "");
            Add("Titan's Mitt", "");
            Add("Pegasus Boots", "");
        }

        private void Add(String name, String base64String)
        {
            try
            {
                var bf = new BinaryFormatter();
                var data = Convert.FromBase64String(base64String);

                using (var ms = new MemoryStream(data))
                {
                    Add(name, (Image)bf.Deserialize(ms));
                }
            }
            catch (Exception)
            {
                Log.Error("Unable to decode image for " + name);
            }
        }
    }
}
